const containerStyle = {
    display: "flex",
    height: "100%",
    overflow: "auto",
};
const mainPaneStyle = {
    overflow: "auto",
};
const division = {
    background: "#ccc",
};
const secondPaneStyle = {
    flexGrow: 1,
    overflow: "auto",
    flex: "1 0 0",
};
export { containerStyle, mainPaneStyle, division, secondPaneStyle };
